import { useEffect, useState } from "react";

const data = () => {
    const [foods, setFoods] = useState<FoodItem[]>([]);

    useEffect(() => {
        const fetchData = async () => {
          await fetch("products.json")
          .then(response => response.json())
          .then(json => setFoods(json))
        }
        fetchData()
        .catch(console.error)
      }, []);

